import React from "react";

const textinput = (name) =>
{
  return(
    <input
    type="text"
    placeholder={name}
    className="form-input"
    />
  )
} 

const input = (name) => 
{
  return(
    <input
    type="number"
    placeholder={name}
    className="form-input-half"
    />
  )
}

export default function XX ()
{
  input()
  textinput()
}
